INSERT INTO `segments` VALUES (1001,1,NULL,'NFDBB2FA9-tu1','0','','','La battaglia di Waterloo (denominata inizialmente dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione fra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Blücher.','40d842f3195afefaab3259900f90b9f2',' ','',54.00,1),(1002,1,NULL,'NFDBB2FA9-tu1','1','','','Fu una delle più combattute e sanguinose battaglie delle guerre napoleoniche, nonché l\'ultima battaglia di Napoleone, che segnò la sua definitiva sconfitta e il conseguente esilio a Sant\'Elena.','b9f2a74a706db6eab92aa55809bdaad1',' ','',30.00,1),(1003,1,NULL,'NFDBB2FA9-tu1','2','','','La battaglia in realtà ebbe luogo nel territorio del villaggio di Mont-Saint-Jean, situato alcuni chilometri a sud della cittadina di Waterloo, nella quale si trovava il quartier generale del Duca di Wellington.','017b649e40fa3b9699559226e60bb62a','','',32.00,1),(1004,1,NULL,'NFDBB2FA9-tu2','0','','','Ancora oggi nei pressi di Waterloo è ricordata la grande battaglia con una serie di monumenti, ed esiste un museo dedicato al famoso scontro.','a343ad28e94d899de4b8233e2bb76d9d',' ','',24.00,1),(1005,1,NULL,'NFDBB2FA9-tu2','1','','','L\'intera zona è un parco storico.','567cd032fbe2cbab02e01e525c8722e3','','',7.00,1),(1006,1,NULL,'NFDBB2FA9-tu3','0','','','Dopo la fuga di Napoleone dall\'isola d\'Elba nel marzo 1815 numerosi Stati europei si unirono in un\'alleanza militare dando vita alla settima coalizione, con lo scopo di sconfiggere definitivamente l\'imperatore francese.','ae18fa9aa2ceac415525fa352097736b',' ','',35.00,1),(1007,1,NULL,'NFDBB2FA9-tu3','1','','','Napoleone decise di attaccare di sorpresa i due eserciti che Regno Unito e Prussia avevano raggruppato in Belgio; l\'imperatore sperava di raggiungere una rapida vittoria sfruttando la scarsa coesione dei suoi avversari.','959c54d693f277403db6f620604afc69','','',33.00,1),(1008,1,NULL,'NFDBB2FA9-tu4','0','','','Due giorni prima di Waterloo i francesi avevano sconfitto i prussiani nella battaglia di Ligny ma Wellington, informato che Blücher era riuscito a riorganizzare il suo esercito e sembrava intenzionato a marciare in suo aiuto, prese la decisione di rischiare una battaglia contro le forze di Napoleone.','0484abe82f4bb7dfa820c59f82c1dd71',' ','',47.00,1),(1009,1,NULL,'NFDBB2FA9-tu4','1','','','Il generale britannico schierò i suoi uomini in difesa lungo la scarpata di Mont-Saint-Jean, vicino alla strada per Bruxelles, confidando nell\'aiuto dei prussiani.','dc3b2cb48a67ac0772de94ecc4d12dfd',' ','',24.00,1),(1010,1,NULL,'NFDBB2FA9-tu4','2','','','Napoleone sferrò una serie di sanguinosi attacchi contro le linee britanniche a partire dalle ore 11:30 e nel tardo pomeriggio sembrò vicino alla vittoria, ma l\'ostinata resistenza del nemico e l\'arrivo in massa dei prussiani decise alla fine la battaglia a favore dei coalizzati.','609b4d6ac621692bd3d6f45855d66232','','',47.00,1),(1011,1,NULL,'NFDBB2FA9-tu5','0','','','Ancora oggi nei pressi di Waterloo è ricordata la grande battaglia con una serie di monumenti, ed esiste un museo dedicato al famoso scontro.','a343ad28e94d899de4b8233e2bb76d9d',' ','',24.00,1),(1012,1,NULL,'NFDBB2FA9-tu5','1','','','L\'intera zona è un parco storico.','567cd032fbe2cbab02e01e525c8722e3','','',7.00,1),(1013,1,NULL,'NFDBB2FA9-tu6','0','','','Ancora oggi nei pressi di Waterloo è ricordata la grande battaglia con una serie di monumenti, ed esiste un museo dedicato al famoso scontro.','a343ad28e94d899de4b8233e2bb76d9d',' ','',24.00,1),(1014,1,NULL,'NFDBB2FA9-tu6','1','','','L\'intera zona è un parco storico.','567cd032fbe2cbab02e01e525c8722e3','','',7.00,1),(1015,1,NULL,'NFDBB2FA9-tu7','0','','','Ancora oggi nei pressi di Waterloo è ricordata la grande battaglia con una serie di monumenti, ed esiste un museo dedicato al famoso scontro.','a343ad28e94d899de4b8233e2bb76d9d',' ','',24.00,1),(1016,1,NULL,'NFDBB2FA9-tu7','1','','','L\'intera zona è un parco storico.','567cd032fbe2cbab02e01e525c8722e3','','',7.00,1);
INSERT INTO `segment_translations` VALUES (1001,1,'40d842f3195afefaab3259900f90b9f2',NULL,'APPROVED','The Battle of Waterloo ( named initially by the French battle of Mont Saint-Jean and by the Prussian Battle of Belle-Alliance ) took place in June 18, 1815 during the war of the Seventh coalition between the French army led by Napoleon Bonaparte and the British armies of the Duke Wellington and Prussian Field Marshal Gebhard Leberecht von Blücher.',NULL,0,'ICE',NULL,0.00,0.00,'[{\"id\":\"590561300\",\"raw_segment\":\"La battaglia di Waterloo (denominata inizialmente dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione fra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Bl\\u00fccher.\",\"segment\":\"La battaglia di Waterloo (denominata inizialmente dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione fra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Bl\\u00fccher.\",\"translation\":\"The Battle of Waterloo ( named initially by the French battle of Mont Saint-Jean and by the Prussian Battle of Belle-Alliance ) took place in June 18, 1815 during the war of the Seventh coalition between the French army led by Napoleon Bonaparte and the British armies of the Duke Wellington and Prussian Field Marshal Gebhard Leberecht von Bl\\u00fccher.\",\"target_note\":\"\",\"raw_translation\":\"The Battle of Waterloo ( named initially by the French battle of Mont Saint-Jean and by the Prussian Battle of Belle-Alliance ) took place in June 18, 1815 during the war of the Seventh coalition between the French army led by Napoleon Bonaparte and the British armies of the Duke Wellington and Prussian Field Marshal Gebhard Leberecht von Bl\\u00fccher.\",\"quality\":\"74\",\"reference\":null,\"usage_count\":13,\"subject\":\"All\",\"created_by\":\"MateCat\",\"last_updated_by\":\"MateCat\",\"create_date\":\"2019-06-14 12:59:53\",\"last_update_date\":\"2019-06-14\",\"match\":\"100%\",\"prop\":[],\"memory_key\":\"\",\"ICE\":true,\"tm_properties\":[{\"type\":\"x-project_id\",\"value\":\"24\"},{\"type\":\"x-project_name\",\"value\":\"Waterloo_IT.docx\"},{\"type\":\"x-job_id\",\"value\":\"24\"}],\"source_note\":\"\"},{\"id\":\"586435386\",\"raw_segment\":\"La battaglia di Waterloo (denominata principio dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione tra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Bl\\u00fccher.\",\"segment\":\"La battaglia di Waterloo (denominata principio dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione tra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Bl\\u00fccher.\",\"translation\":\"La battaglia di Waterloo (denominata inizialmente dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione fra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Bl\\u00fccher.\",\"target_note\":\"\",\"raw_translation\":\"La battaglia di Waterloo (denominata inizialmente dai francesi battaglia di Mont Saint-Jean e dai prussiani battaglia di Belle-Alliance) si svolse il 18 giugno 1815 durante la guerra della Settima coalizione fra le truppe francesi guidate da Napoleone Bonaparte e gli eserciti britannico del Duca di Wellington e prussiano del feldmaresciallo Gebhard Leberecht von Bl\\u00fccher.\",\"quality\":\"74\",\"reference\":null,\"usage_count\":1,\"subject\":\"All\",\"created_by\":\"MateCat\",\"last_updated_by\":\"MateCat\",\"create_date\":\"2019-02-26 16:43:36\",\"last_update_date\":\"2019-02-26\",\"match\":\"96%\",\"prop\":[],\"memory_key\":\"\",\"ICE\":false,\"tm_properties\":null,\"source_note\":\"\"}]','The Battle of Waterloo ( named initially by the French battle of Mont Saint-Jean and by the Prussian Battle of Belle-Alliance ) took place in June 18, 1815 during the war of the Seventh coalition between the French army led by Napoleon Bonaparte and the British armies of the Duke Wellington and Prussian Field Marshal Gebhard Leberecht von Blücher.',100,'TM',NULL,0.00000000000000,'DONE',1,0,'',0,NULL),(1002,1,'b9f2a74a706db6eab92aa55809bdaad1',NULL,'APPROVED','It was one of the most fought and bloody battles of the Napoleonic wars, and the last battle of Napoleon, which marked his final defeat and the subsequent exile on St. Helena.',NULL,0,'ICE',NULL,0.00,0.00,'[{\"id\":\"590846146\",\"raw_segment\":\"Fu una delle pi\\u00f9 combattute e sanguinose battaglie delle guerre napoleoniche, nonch\\u00e9 l\'ultima battaglia di Napoleone, che segn\\u00f2 la sua definitiva sconfitta e il conseguente esilio a Sant\'Elena.\",\"segment\":\"Fu una delle pi\\u00f9 combattute e sanguinose battaglie delle guerre napoleoniche, nonch\\u00e9 l\'ultima battaglia di Napoleone, che segn\\u00f2 la sua definitiva sconfitta e il conseguente esilio a Sant\'Elena.\",\"translation\":\"It was one of the most fought and bloody battles of the Napoleonic wars, and the last battle of Napoleon, which marked his final defeat and the subsequent exile on St. Helena.\",\"target_note\":\"\",\"raw_translation\":\"It was one of the most fought and bloody battles of the Napoleonic wars, and the last battle of Napol